import React from 'react';
import { Typography } from '@mui/material';
import Messages from '../components/Messages';

const MessagesPage = () => {
  return (
    <div>
      <Typography variant="h4" component="h1" gutterBottom>
        Messages
      </Typography>
      <Messages />
    </div>
  );
};

export default MessagesPage;
